from django.db import models
from phone_field import PhoneField

class MemberInfo(models.Model):
    memberid = models.AutoField(primary_key=True, default=None, verbose_name="ID.")
    firstname = models.CharField(max_length=45, verbose_name="First Name:")
    lastname = models.CharField(max_length=45, verbose_name="Last Name:")
    handicap = models.IntegerField(null=True, default=None, blank=True, verbose_name="Handicap 9")
    handicap18 = models.IntegerField(null=True, default=None, blank=True, verbose_name="Handicap 18")
    chgopt9 = models.IntegerField(null=True, default=None, blank=True, verbose_name="Chgo. Pts. 9")
    chpt18 = models.IntegerField(null=True, default=None, blank=True, verbose_name="Chgo. Pts. 18")
    add1 = models.CharField(max_length=45, default=None, blank=True, verbose_name="Address #1:")
    add2 = models.CharField(max_length=45, default=None, blank=True, verbose_name="Address #2:")
    city = models.CharField(max_length=45, default=None, blank=True, verbose_name="City:")
    st = models.CharField(max_length=2, default=None, blank=True, verbose_name="St:")
    zipcode = models.CharField(max_length=15, default=None, blank=True, verbose_name="Zip Code:")
    cell = PhoneField(blank=True, default=None, verbose_name="Cell Phone:")
    home = PhoneField(blank=True, default=None, verbose_name="Home Phone:")
    email = models.EmailField(max_length=254, default=None, blank=True, verbose_name="Email:")
    playing = models.BooleanField(verbose_name="", default=False, blank=True)
    doubles = models.IntegerField(null=True, default=None, blank=True, verbose_name="Doubles")
    round1 = models.IntegerField(null=True, default='0', blank=True, verbose_name="Round 1")
    round2 = models.IntegerField(null=True, default='0', blank=True, verbose_name="Round 2")
    round3 = models.IntegerField(null=True, default='0', blank=True, verbose_name="Round 3")
    round4 = models.IntegerField(null=True, default='0', blank=True, verbose_name="Round 4")
    round5 = models.IntegerField(null=True, default='0', blank=True, verbose_name="Round 5")
    avg = models.IntegerField(null=True, default='0', blank=True, verbose_name="Average")
    money = models.IntegerField(null=True, default="0", blank=True, verbose_name="money")

    def get_absolute_url(self):
        return f"/PRGCdatabase/home"

    def get_absolute2_url(self):
        return f"/PRGCdatabase/{self.memberid}/memberinfo"

    def get_absolute3_url(self):
        return f"/PRGCdatabase/member_info_existing"

    def get_absolute4_url(self):
        return f"/PRGCdatabase/newgame"

    def get_absolute5_url(self):
        return f"/PRGCdatabase/{self.memberid}/playing"


